import React, { Component } from 'react'

export default class ShowBid extends Component {
  constructor(props) {
    super(props) 

  }
  componentDidMount() {
    axios.get("").then(beer => {
     this.setState({
       ...this.state,
       randomBeer: {...beer.data}
     })
     console.log(this.state.randomBeer)
   })
 }

  render() {
    return (
      <React.Fragment>
        <h1>Panel de control de tu mudanza</h1>





      </React.Fragment>
    )
  }
}
